const pdf = require("pdf-creator-node");
const fs = require("fs");
const html = fs.readFileSync("./pdf-generation/template-image.html", "utf8");

const icons = {
    tick:
        "data:image/png;base64,",
    cross:
        "data:image/png;base64,",
};

const options = {
    format: "A4",
    orientation: "portrait",
    border: "10mm",
    footer: {
        height: "10mm",
        contents: {
            default: `
          <div
              style="
              border-top: 1px solid black;
              left: 30px;
              right: 30px;
              "
          />
          <div style="float: left; font-size: 18px;">
              SMART INDIA HACKATHON 2020
          </div>
          <div style="float: right; font-size: 18px;">
              THE SENTINELS | MES COLLEGE OF ENGINEERING, PUNE
          </div>
          `,
        },
    },
};

module.exports = (d, callback) => {
    var document = {
        html: html,
        data: {
            user: " The Sentinels",
            imgSource: d.status == "REAL" ? icons.tick : icons.cross,
            reportTitle: d.status == "REAL" ? "Image Verified Real" : "Image Found Fake",
            userId: d.userId,
            imageId: d.imageId,
            size: d.size + " bytes",
            checksum: d.checksum,
            confidence: d.confidence,
            isFacePresent: d.isFacePresent == true ? "Yes" : "No",
        },
        path: "./pdf-cache/" + d.imageId + ".pdf",
    };
    pdf.create(document, options)
        .then((res) => {
            callback(res);
        })
        .catch((error) => {
            console.error(error);
        });
};
